import{_ as a,c as t,o as e,a5 as i}from"./chunks/framework.B102yH4G.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"js/JavaScript中的原型，原型链分别是什么.md","filePath":"js/JavaScript中的原型，原型链分别是什么.md","lastUpdated":1715864760000}'),l={name:"js/JavaScript中的原型，原型链分别是什么.md"},o=i('<h2 id="javascript中的原型-原型链分别是什么" tabindex="-1">JavaScript中的原型，原型链分别是什么? <a class="header-anchor" href="#javascript中的原型-原型链分别是什么" aria-label="Permalink to &quot;JavaScript中的原型，原型链分别是什么?&quot;">​</a></h2><p>原型就是一个普通对象，它是为构造函数的实例共享属性和方法；所有实例中引用的原型都是同一个对象</p><h3 id="关系" tabindex="-1">关系 <a class="header-anchor" href="#关系" aria-label="Permalink to &quot;关系&quot;">​</a></h3><ul><li>构造函数有prototype属性，即原型，属性和方法可以挂载在原型上</li><li>prototype上有一个constructor属性，指向构造函数本身</li><li>实例对象拥有__proto__属性，可以理解为指针，指向了构造函数的原型（prototype）</li></ul><h3 id="过程" tabindex="-1">过程 <a class="header-anchor" href="#过程" aria-label="Permalink to &quot;过程&quot;">​</a></h3><ol><li>当访问一个对象的属性时，会先在对象本身查找</li><li>如果没有，会通过实例对象的__proto__找到其构造函数的原型，在其构造函数的原型上找</li><li>如果找不到，依此往上在原型对象中查找</li><li>直到找到匹配的属性或者到达原型链顶层，也就是Object的原型null</li><li>这种关系就称为原型链</li></ol><ul><li>一切对象都是继承自Object对象，Object.prototype为null</li><li>一切函数对象，都是继承自Function对象</li></ul>',7),r=[o];function _(c,s,n,p,d,h){return e(),t("div",null,r)}const f=a(l,[["render",_]]);export{m as __pageData,f as default};
